import React from "react";
import "./Filter.css";
const Filter = () => {
    const FilterElement = ['All', 'Javascript','PHP'];
   
  return (
    <div className="Filter d__flex align__items__center">
      <div className="Filter__container d__flex ">
      {
        FilterElement.map((a,i)=>{
            console.log(a);
            <div className="Filter_item pointer mx-5" key={i}>
                <span>{a,i}</span>
            </div>
        })
    }
        
      </div>
    </div>
  );
};

export default Filter;
